";s:11:"vod_content";s:2811:"黑萝莉露露与白萝莉依兰是一对高中生好朋友，两人青春，靓丽，无忧无虑的好年华黑萝莉表面上是学生，实际上还有另外一个职业，援交少女，她专门勾引那些成熟的男人，跟他们发生关系来赚钱，她家并不富裕，她的父亲早逝，妈妈也整天打牌不管她，所以她赚钱来满足自己的欲望，还有梦想。她的梦想是将来考上美术学院，她有画画的天赋，每次跟客人发生关系之后，都会把这些人的样子画成素描，黑萝莉和白萝莉一边游玩北京，一边把自己和那些男人的故事讲给白萝莉听，白萝莉起初非常好奇，后来，她看到黑萝莉那么辛苦，就劝黑萝莉不要再做了，黑萝莉说等自己赚够了钱，就不会再做。白萝莉把着小男友叫出来和一起黑萝莉玩，黑萝莉看她小男友看自己的眼神不对就想让白萝莉看清这个世界，于是黑萝莉故意叫小男友去买水让白萝莉趁机躲在远处，只见黑萝莉把小男友带到了一个角落，小男友开始对性感的黑萝莉动手动脚，这一幕都被白萝莉看在眼里，白萝莉非常生气，黑萝莉说只是想让她认清楚这些男人的丑恶嘴脸，白萝莉并不领情，和黑萝莉关系闹僵。　　黑萝莉还在继续自己的夜生活，她在夜店里认识了一个中年男人，他非常儒雅，温柔，待她像对待自己的女儿一样，两人在酒店里缠绵，黑萝莉爱上了他，觉得自己好像找到了久违的父爱。一天，白萝莉来找黑萝莉，经过这段时间，她终于想通了，两人恢复了好友关系，白萝莉也对这个充满谎言的世界彻底失望想和黑萝莉一样做真实的自己，她也想尝试一回，要黑萝莉给她介绍客人。于是黑萝莉把她爱上的那个温柔的中年男人介绍给白萝莉。黑萝莉和白萝莉来到相约的酒店，黑萝莉给她戴上了面具，因为这个客人喜欢这样。白萝莉带着面具走向了房间，黑萝莉拿着她的包出了酒店，在酒店外的马路上因一位路人不小心撞掉了白萝莉的包，白萝莉一家的全家福掉了出来，黑萝莉看到了照片上的男人——白萝莉的父亲，发现他就是那个自己爱上后介绍给白萝莉的那个客人，黑萝莉疯狂的往酒店跑去，带走了白萝莉，这时父亲也发现了原来来的女孩就是自己的女儿，他感觉非常愧疚、悔恨，于是选择了自杀。黑萝莉回到家里，被妈妈带回来的男人偷窥，妈妈打伤了那个男人，自己来担当所有的罪责，黑萝莉这才明白妈妈是爱自己的，她内心受到震动。最后，白萝莉去了日本东京留学，黑萝莉也幡然醒悟，不再继续做援助交际。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:60:"BD$https://eth.ppzuida.com/20190407/5447_6ccc118c/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids";N;}s:6:"type_1";N;}i:5;a:80:{s:6:"vod_id";i:51853;s:7:"type_id";i:4;s:9:"type_id_1";i:0;s:8:"gro